pragma solidity ^0.8.0;

/* 
8. 아래의 함수를 만드세요

    1~10을 입력하면 “A” 반환받습니다.

    11~20을 입력하면 “B” 반환받습니다.

    21~30을 입력하면 “C” 반환받습니다.

 */


contract Q8 {

    function getLetter(uint _n) public pure returns(string memory) {
        if(1<= _n && _n <= 10) {
            return "A";
        } else if(11<= _n && _n <= 20) {
            return "B";
        } else if(21 <= _n && _n <= 30) {
            return "C";
        } else {
            return "X";
        }

    }
}

